                "closed_at": "2014-09-14T22:40:13Z",
                "body": "Having tons of npm errors in my 12.04 Ubuntu distro. After proceeding normally through the first part of the node.js tutorial I have arrived upon the express install portion. After typing \"npm install express\" I get installation errors. \r\n\r\nReceived several warnings such as \"UNKNOWN\" and \"Unsupported\". Performed an npm uninstall and reinstall to troubleshoot with no luck. \r\n\r\n**Getting very frustrated with this assignment in total. Poured in 4 hours so far, attempting to learn all I can and it is feeling like I won't finish by tonight. I would love to see a different teaching approach for these weekend assignments and some assignment change or exception for this one with all of the software issues I have been tripping over.**\r\n\r\nAny help with this npm issue would be greatly appreciated. \r\n\r\n![image](http://i.imgur.com/iOcgLWB.png)"
